<style lang="less" scoped>
    .tackPicture {
        height: 100%;
        .dialog-footer{
            position: absolute;
            z-index: 10;
            bottom: -160px;
            left: 0;
            right: 0;
            transition: .1s linear;
            background: #f5f5f5;
            &-control{
                width: 100%;
                display: flex;
                flex-direction: column;
                justify-content: center;
                align-items: center;
                background: #fff;
                &-item{
                    padding: 15px 0;
                    width: 100%;
                    text-align: center;
                    font-family: PingFangSC-Regular;
                    font-size: 14px;
                    color: #333333;
                }
            }
            &-cancel{
                width: 100%;
                height: 50px;
                text-align: center;
                line-height: 50px;
                margin-top: 10px;
                background: #fff;
                font-size: 14px;
            }
        }
        .show_dialog {
            transition: .1s linear;
            bottom: 0;
        }
    }
</style>
<template>
    <div class="tackPicture" touch.stop v-if="showDialog">
        <div class="dialog-footer" :class="{'show_dialog': showDialog && isShow}">
            <div class="dialog-footer-control">
                <span class="dialog-footer-control-item bd-bottom" @click="tackPicture(1)">拍照</span>
                <span class="dialog-footer-control-item" @click="tackPicture(2)">从相册选取</span>
            </div>
            <div class="dialog-footer-cancel" @click="cancelBottom">取消</div>
        </div>
    </div>
</template>
<script>
    import platform from '../platform'
    export default {
        data() {
            return {
                listPicStr: '',
                isShow: true
            }
        },
        props: {
            showDialog: {
                type: Boolean,
                default: false
            },
            pictureNum: {
                type: Number,
                default: 0
            }
        },
        watch: {
            showDialog (newVal) {
                if (newVal) {
                    this.isShow = newVal;
                }
            }
        },
        methods: {
            // 处理用户取消拍照
            cancelTackPic() {
                this.$emit('cancel-tack')
            },
            cancelBottom() {
                this.$emit('on-cancel')
            },
            getValue() {
                let msg = '';
                return msg;
            },
            tackPicture(key) {
                this.isShow = false;
                this.cancelTackPic();
                if (this.pictureNum >= 3) return this.$toast('最多上传3张图片！');
                let base64 = "data:image/jpeg;base64,";
                let clientSize = this.storage.get('clientSize');
                let msg = this.getValue();
                if ($conf.isPcTest) {
                    this.listPicStr = '';
                    this.listPicStr += this.listPicStr === '' ? base64 + msg : 'mideaMmp2016' + base64 + msg;
                    this.$emit('tackPicture', this.listPicStr);
                    this.isShow = true;
                } else {
                    var paramObj;
                    if (key == 1) {
                        paramObj = {
                            quality: 30,
                            targetWidth : clientSize.webviewWidth,
                            targetHeight : clientSize.webviewHeigh,
                            sourceType: key,
                            // sourceType: key
                        };
                        platform.getPicture(paramObj).then((result) => {
                            let base64 = "data:image/jpeg;base64,";
                            if (result.indexOf('.') >= 0) {
                                platform.compressURI([result]).then((msg) => {
                                    platform.getBase64CodeFromPictures(msg).then(res => {
                                        this.$showLoading();
                                        var pictureData = base64 + res.base64[0];
                                        this.listPicStr = '';
                                        this.listPicStr += this.listPicStr === '' ? pictureData : 'mideaMmp2016' + pictureData;
                                        this.$emit('tackPicture', this.listPicStr);
                                        this.isShow = true;
                                        throw ('base64 error')
                                    }).catch(err => {
                                        throw ('base64 error')
                                    });
                                }, (e) => {
                                    this.isShow = true;
                                    console.log('uri压缩失败:' + e)
                                })
                            } else {
                                this.isShow = true;
                                resolve(msg)
                            }
                        }, (e) => {
                            this.isShow = true;
                            console.log('获取uri失败：' + e)
                        })
                    } else {
                        paramObj = 3 - this.pictureNum*1;
                        platform.tackPic(paramObj).then((result) => {
                            platform.compressURI(result).then((msg) => {
                                platform.getBase64CodeFromPictures(msg).then(data => {
                                    this.$showLoading();
                                    this.listPicStr = '';
                                    data.base64.forEach((item, index) => {
                                        if (index == 0) {
                                            this.listPicStr = base64 + item
                                        } else {
                                            this.listPicStr += 'mideaMmp2016' + base64 + item;
                                        }
                                    });
                                    this.$emit('tackPicture', this.listPicStr);
                                    this.isShow = true;
                                    throw ('base64 error')
                                }).catch(err => {
                                    this.isShow = true;
                                    throw ('base64 error')
                                });
                            }, (e) => {
                                this.isShow = true;
                                console.log('uri压缩失败:' + e)
                            })
                        }, (e) => {
                            this.isShow = true;
                            console.log('获取uri失败：' + e)
                        })
                    }
                }
            }
        }
    }
</script>
